INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300148, 1, "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！", 1, 0.0, "vo_minigame_1012_result_1080", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300149, 2, "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！", 8, 2.21, "vo_minigame_1012_result_1081", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300150, 2, "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！", 3, 2.46, "vo_minigame_1012_result_1082", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300151, 2, "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？", 3, 2.94, "vo_minigame_1012_result_1083", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300152, 3, "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ", 7, 4.19, "vo_minigame_1012_result_1084", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300153, 3, "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？", 1, 0.0, "vo_minigame_1012_result_1085", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300154, 3, "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！", 3, 2.63, "vo_minigame_1012_result_1086", 1, 3001, 9, 0, 1, 5);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300155, 1, "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか", 3, 5.53, "vo_minigame_1012_result_1087", 1, 3001, 4, 0, 1, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300156, 1, "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？", 3, 0.01, "vo_minigame_1012_result_1088", 1, 3001, 4, 9, 3, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300157, 1, "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！", 3, 4.15, "vo_minigame_1012_result_1089", 1, 3001, 4, 3, 1, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300158, 2, "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？", 9, 0.01, "vo_minigame_1012_result_1090", 1, 3001, 4, 9, 9, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300159, 2, "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！", 3, 5.37, "vo_minigame_1012_result_1091", 1, 3001, 4, 0, 1, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300160, 2, "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～", 3, 1.44, "vo_minigame_1012_result_1092", 1, 3001, 4, 0, 1, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300161, 3, "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？", 3, 0.0, "vo_minigame_1012_result_1093", 1, 3001, 4, 0, 3, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300162, 3, "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！", 3, 2.91, "vo_minigame_1012_result_1094", 1, 3001, 4, 3, 9, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300163, 3, "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！", 5, 2.61, "vo_minigame_1012_result_1095", 1, 3001, 4, 0, 1, 1);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300164, 1, "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！", 4, 3.63, "vo_minigame_1012_result_1096", 1, 3001, 0, 1, 2, 0);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300165, 1, "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？", 6, 4.16, "vo_minigame_1012_result_1097", 1, 3001, 0, 1, 2, 0);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300166, 1, "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…", 3, 0.01, "vo_minigame_1012_result_1098", 1, 3001, 0, 6, 3, 0);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300167, 2, "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！", 6, 5.75, "vo_minigame_1012_result_1099", 1, 3001, 0, 0, 2, 0);
INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300168, 2, "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！", 4, 5.64, "vo_minigame_1012_result_1100", 1, 3001, 0, 1, 2, 0);
