INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 12300170, 3, "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！", 5, 5.32, "vo_minigame_1012_result_1102", 1, 3001, 0, 1, 3, 0);
