INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 22300160, 2, "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？", 4, 4.29, "vo_minigame_1012_result_2092", 2, 3001, 4, 3, 10, 1);
