INSERT INTO `v1_cc0ad7ddee4095eb095c8729873d8f4241f3e6fd9cadf44ee1a8a92489efec59` VALUES (2, 22300162, 3, "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！", 9, 3.14, "vo_minigame_1012_result_2094", 2, 3001, 4, 0, 5, 1);
